import React, {Component} from 'react';
import Photo from './Photo';

class PhotoWall extends Component{
    render(){
        return(
            <div>
                {this.props.posts.map((post) => <Photo key={index} post={post}/>)}
            </div>
        )
    }
}
export default PhotoWall;
